import React from 'react';
import "./Insights.css"
function Insights() {
  return (
    <div className="insights">
      <div className="sales">
        <h3>Teachers</h3>
        <h1>4</h1>
      </div>
      <div className="expenses">
        <h3>Students</h3>
        <h1>20</h1>
      </div>
      <div className="income">
        <h3>Gender of students</h3>
        <h1>Girls: 10</h1>
        <h1>Boys: 10</h1>
      </div>
    </div>
  );
}

export default Insights;
